> Top News No. 7 Spartans use blunder to shock No. 12 Michigan, 27-23 Michigan punter Blake O'Neill (12) walks off the field after an NCAA college football game against Michigan State in Ann Arbor, Mich., Saturday, Oct. 17, 2015. Michigan State's Jalen Watts-Jackson grabbed a flubbed punt by O'Neill and lumbered 38 yards into the end zone for a touchdown on the final play of the game, giving No. 7 Michigan State a shocking 27-23 win over No. 12 Michigan. (AP Photo/Tony Ding) 
